const path = require('path')

const { remote, nativeImage } = require('electron')

function handleThumbar(state = 'stopped', onPlay, onPause, onPrevious, onNext) {
  // Only supported on Windows
  if (process.platform !== 'win32') {
    return
  }

  const mainWindow = remote.getCurrentWindow()

  mainWindow.setThumbarButtons([
    {
      icon: nativeImage.createFromDataURL('data:image/png;base64,'),
      click: onPrevious,
      tooltip: 'Previous',
      flag: [(state === 'stopped' ? 'disabled' : 'enabled')],
    },
    {
      icon: nativeImage.createFromDataURL(`${(state === 'playing' ? 
        'data:image/png;base64,' : 
        'data:image/png;base64,'
      )}`),
      click: state === 'playing' ? onPause : onPlay,
      tooltip: 'Play',
      flag: [(state === 'stopped' ? 'disabled' : 'enabled')],
    },
    {
      icon: nativeImage.createFromDataURL('data:image/png;base64,'),
      click: onNext,
      tooltip: 'Next',
      flag: [(state === 'stopped' ? 'disabled' : 'enabled')],
    },
  ])
}

module.exports = handleThumbar
